import React from 'react';
import { useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate(); 

  const goToTopTracks = () => {
    navigate('/top-tracks');
  };

  return (
    <div>
      <h1>Home Page</h1>
      <p>Welcome to your Spotify data dashboard!</p>
      <button onClick={goToTopTracks}>View Top Tracks</button>
    </div>
  );
};

export default Home;
